import React from 'react';
import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`https://localhost:5000/`)
  }

  render() {
    return (
      componentDidMount()
    )
  }
}
